Sometimes yurt manufacturers have floor models, canceled orders, returns, etc., that they need to sell.  This category is just for those instances.  

&lt;B&gt;This is NOT for placing orders for new yurts!&lt;/B&gt;

Any manufacturers found selling new yurts in this section will be permanently banned from the classifieds and the forums.

